# Creation transaction with max allowed initcode size (EIP-3860)
creationTxInitCodeSizeLimit:
  env:
    currentCoinbase: 2adc25665018aa1fe0e6bc666dac8fc2697ff9ba
    currentDifficulty: '0x020000'
    currentGasLimit: '20000000'
    currentBaseFee: '10'
    currentNumber: '1'
    currentTimestamp: '1000'

  pre:
    a94f5374fce5edbc8e2a8697c15331677e6ebf0b:
      balance: 200000000
      code: ''
      nonce: 0
      storage: {}

  transaction:
    data: 
      # "codecopy(0x00, 0x0b, 0x10) return(0x00, 0x10)"
      # initcode size = 49152
      - ':label valid :raw '
      # initcode size = 49153 (valid only before EIP-3860)
      - ':label invalid :raw '
    gasLimit:
      - 15000000
    gasPrice: 10
    nonce: 0
    secretKey: 45a915e4d060149eb4365960e6a7a45f334393093061116b197e3240065ff2d8
    to: ''
    value:
    - 0

  expect:

    - indexes:
       data: ':label valid'
      network:
        - 'Cancun'
      result:
       a94f5374fce5edbc8e2a8697c15331677e6ebf0b:
          # Difference with Paris is the charge for initcode 49152 // 32 * 2 = 3072 gas
          balance: 195569440
          nonce: 1
       6295ee1b4f6dd65047762f924ecd367c17eabf8f:
          balance: 0
          nonce: 1
          code: '0x60606040523615610074576000357c01'
          storage: {}
          
    - indexes:
       data: ':label valid'
      network:
        - '>=Prague'
      result:
       a94f5374fce5edbc8e2a8697c15331677e6ebf0b:
          balance: 190196000
          nonce: 1
       6295ee1b4f6dd65047762f924ecd367c17eabf8f:
          balance: 0
          nonce: 1
          code: '0x60606040523615610074576000357c01'
          storage: {}

    - indexes:
       data: ':label invalid'
      network:
        - '>=Cancun'
      expectException:
        '>=Cancun' : 'TransactionException.INITCODE_SIZE_EXCEEDED'
      result:
       a94f5374fce5edbc8e2a8697c15331677e6ebf0b:
          nonce: 0
       6295ee1b4f6dd65047762f924ecd367c17eabf8f:
          shouldnotexist: 1
